import { Col, Row } from 'react-bootstrap'
import { connect } from 'react-redux'
import React from 'react'

import ListPokemonsLoadMoreBar from './ListPokemonsLoadMoreBar'
import ListPokemonsSortBar from './ListPokemonsSortBar'
import PokemonCard from '../_common/PokemonCard'

const ListPokemons = ({ pokemons }) => (
	<div>
		<ListPokemonsSortBar />

		<Row>
			{pokemons.map(pokemon => (
				<Col md={4} key={pokemon.id}>
					<PokemonCard pokemon={pokemon} />
				</Col>
			))}
		</Row>

		<ListPokemonsLoadMoreBar />
	</div>
)

const mapState = state => ({
	pokemons: state.pokemons.list
})

export default connect(mapState)(ListPokemons)
